import React from 'react';
import { Navbar, Container, Nav } from 'react-bootstrap';
import { Link } from 'react-router-dom';

const Home = ({}) => {
  return (
    <>
        <header>
            <h1>durand enterprises</h1>
        </header>
            <Navbar bg="light" expand="lg" collapseOnSelect>
                <Container>
                    <Navbar.Toggle aria-controls="basic-navbar-nav" />
                    <Navbar.Collapse id="basic-navbar-nav">
                    <Nav className="ml-auto">
                        <Nav.Link as={Link} to='/about' className="home-nav-link"><h1>About Me</h1></Nav.Link>
                        <Nav.Link as={Link} to='/portfolio' className="home-nav-link"><h1>My Work</h1></Nav.Link>
                        <Nav.Link as={Link} to='/contact' className="home-nav-link"><h1>Contact</h1></Nav.Link>
                    </Nav>
                    </Navbar.Collapse>
                </Container>
            </Navbar>
        <footer>
            <p id='home-footer-text'>Background video courtesy of <a href='http://www.beachfrontbroll.com/' id='home-footer-link'>Beachfront B-Roll</a></p>
        </footer>
    </>
  )

};

export default Home;
